//drawing

//wating for v_sync to update (basically delay)
void wait_for_vsync(){

	volatile int * pixel_front_ctrl_ptr = (int*)0xFF203020;
	*pixel_front_ctrl_ptr = 1;
	
	volatile int * status_ptr = (int*)0xFF20302C;
	
	
	int status = (*status_ptr);
	
	
	while(((status)&(0x01)) != 0){
		status = (*status_ptr);	

	}

}

//changes the value of the pixel given
void pixelSet(int x, int y, short int color){
	
	volatile short int *one_pixel_address;
	one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);
	
	if(color !=	0x7baf && color != 0x7bed && color != 0x6bad && color != 0x83ce && color != 0x7bce && color != 0x7c8b && color != 0xe489 && color != 0xe4a8 & color != 0x63cc && color !=0x6baa){
	*one_pixel_address = color ;
	}
}

//takes two short ints and makes it into one
short int concatenate(uint8_t a, uint8_t b){
  short int c = ((short int)a<<8)|(short int)b;
  return c;
}


//sets the entire screen black
void clearScreen(){
	for(int x = 0; x < 320; ++x){
		for(int y = 0; y < 240; ++y){
			pixelSet(x, y, 0);
		}
	}
}

//draws the background given the array
void drawMap(){
	int m = 0;
	for(int y = 0 ; y < boundsy; ++y){
		for(int x = 0; x < boundsx;++x){
			pixelSet(x+offsetx,y+offsety,concatenate(theEagle[currentMap].background[m+1], theEagle[currentMap].background[m]));
			m+=2;
		}
	}
}

