void setClusterOfObstacles(int index, int obstacleIndex, int x1, int y1, int numx, int numy, int spacingx, int spacingy){
	int i = obstacleIndex;
	--numx;
	--numy;
	
	for(int y = y1; y <= (y1 + (obstacleHeight*spacingy*numy)); y+=(obstacleHeight*spacingy)){
		for(int x = x1; x <= (x1 + (obstacleWidth*spacingx*numx)); x+=(obstacleWidth*spacingx)){
			setObstacle(index, i, x, y, 0);
			++i;
		}
	}
	
}

//Link Movement

//draws link
void drawLink(){
	if(Link.facing == 0){					//0 means down
		int i = 0;
		for(int y= 0 ; y< 16;++y){
			for(int x= 0; x< 15;++x){
				pixelSet(x+Link.x,y+Link.y,concatenate(linkDown1[i+1], linkDown1[i]));
				i+=2;
			}
		}
	} else if (Link.facing == 1){			//1 means up
		int i = 0;
		for(int y= 0 ; y< 16;++y){
			for(int x= 0; x< 16;++x){
				pixelSet(x+Link.x,y+Link.y,concatenate(linkUp1[i+1], linkUp1[i]));
				i+=2;
			}
		}
	} else if (Link.facing == 2){			//2 means right
		int i = 0;
		for(int y= 0 ; y< 16;++y){
			for(int x= 0; x< 16;++x){
				pixelSet(x+Link.x,y+Link.y,concatenate(linkSide1[i+1], linkSide1[i]));
				i+=2;
			}
		}
	} else if (Link.facing == 3){			//3 means left
		int i = 0;
		for(int y= 0 ; y< 16;++y){
			for(int x = 15; x >=0;--x){
				pixelSet(x+Link.x,y+Link.y,concatenate(linkSide1[i+1], linkSide1[i]));
				i+=2;
			}
		}
	}
}


//moves link downwards, smoothly
void linkDown(){
	volatile int * pixel_ctrl_ptr = (int *)0xFF203020;

	//erasing
	eraseLink();
	
	//updating positon 2 down
	updatePosition(0,updateValue);
	
	//drawing link in the step
	int i = 0;
	for(int y= 0 ; y< 16;++y){
		for(int x= 0; x< 16;++x){
			pixelSet(x+Link.x,y+Link.y,concatenate(linkDown2[i+1], linkDown2[i]));
			i+=2;
		}
	}
	
	//resetting
	wait_for_vsync();
	pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
	
	//delaying
	for(int i = 0; i < delayValue; ++i){
		volatile int *PS2_ptr = (int *) PS2_BASE;
        PS2_data = *(PS2_ptr);
	}
	
	
	//erasing
	eraseLink();
	
	//updating his position 2 down
	updatePosition(0,updateValue);
	
	//drawing link while standing
	i = 0;
	for(int y= 0 ; y< 16;++y){
		for(int x= 0; x< 15;++x){
			pixelSet(x+Link.x,y+Link.y,concatenate(linkDown1[i+1], linkDown1[i]));
			i+=2;
		}
	}
	
	//resetting
	wait_for_vsync();
	pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
}

