//erase link
void eraseLink(){
	volatile short int *one_pixel_address;
	one_pixel_address = pixel_buffer_start + (Link.y << 10) + (Link.x << 1);
	short int color = *one_pixel_address ;
	
	int i = 0;
	
	//past 3 index
	for(int y= 0 ; y < 16;++y){
		for(int x= 0; x< 16;++x){
			i = (2*boundsx*(Link.past3y+y-offsety))+(2*(Link.past3x+x-offsetx));
			pixelSet(x+Link.past3x,y+Link.past3y, concatenate(theEagle[currentMap].background[i+1], theEagle[currentMap].background[i]));
		}
	}
	
	
	//past 2 index
	for(int y = 0 ; y < 16;++y){
		for(int x= 0; x< 16;++x){
			i = (2*boundsx*(Link.past2y+y-offsety))+(2*(Link.past2x+x-offsetx));
			pixelSet(x+Link.past2x,y+Link.past2y, concatenate(theEagle[currentMap].background[i+1], theEagle[currentMap].background[i]));
		}
	}

	//past 1 index
	for(int y= 0 ; y < 16;++y){
		for(int x= 0; x< 16;++x){
			i = (2*boundsx*(Link.past1y+y-offsety))+(2*(Link.past1x+x-offsetx));
			pixelSet(x+Link.past1x,y+Link.past1y, concatenate(theEagle[currentMap].background[i+1], theEagle[currentMap].background[i]));
		}
	}

	//current index
	for(int y= 0 ; y < 16;++y){
		for(int x= 0; x< 16;++x){
			i = (2*boundsx*(Link.y+y-offsety))+(2*(Link.x+x-offsetx));
			pixelSet(x+Link.x,y+Link.y, concatenate(theEagle[currentMap].background[i+1], theEagle[currentMap].background[i]));
		}
	}
}

//updates Links position based on given x, y increments
void updatePosition(int x, int y){
	Link.past3x = Link.past2x;
	Link.past2x = Link.past1x;
	Link.past1x = Link.x;
	Link.x += x;
	Link.bottomx = Link.x+8;
	
	Link.past3y = Link.past2y;
	Link.past2y = Link.past1y;
	Link.past1y = Link.y;
	Link.y += y;
	Link.bottomy = Link.y+16;
	
}

//looks ahead of link based on a direction and check playable bounds and obstacles
int checkLegalMove(int dir){
	int newx = Link.bottomx;
	int newy = Link.bottomy;
	
	if(dir == 0){
		newy += (2*updateValue);
	} else if (dir == 1){
		newy -= (2*updateValue);
	} else if ( dir == 2){
		newx += (2*updateValue);
	} else if (dir == 3){
		newx -= (2*updateValue);
	}
	
	if(checkWayEntry(newx, newy)){
		linkUp();
		return 0;
	}
	
	//checking all playable bounds, if the distance between it greater, calculate a temporary new update value	
	if(newx < playx1){		
		if((Link.bottomx - playx1)/2 > 0){
			updateValue = (Link.bottomx - playx1)/2;
			return 1;
		} else {
			return 0;
		}		
	}
		
	if(newx > playx2){
		if((playx2 - Link.bottomx)/2 > 0){
			updateValue = (playx2 - Link.bottomx)/2;
			return 1;
		} else {
			return 0;
		}
	}
	
	if(newy < playy1){
		if((Link.bottomy - playy1)/2 > 0){
			updateValue = (Link.bottomy - playy1)/2;
			return 1;
		} else {
			return 0;
		}		
	}
		
	if(newy > playy2){
		if((playy2 - Link.bottomy)/2 > 0){
			updateValue = (playy2 - Link.bottomy)/2;
			return 1;
		} else {
			return 0;
		}
	}
	
	//checking all obstacles
	
	if(dir == 1 || dir == 2 || dir == 3){
		newy -= (2*updateValue);
	}
	
	
	for(int i = 0; i < theEagle[currentMap].numOfObstacles; ++i){
		if(newx >= theEagle[currentMap].listOfObstacles[i].x && newx <= (theEagle[currentMap].listOfObstacles[i].x+obstacleHeight) && newy >= theEagle[currentMap].listOfObstacles[i].y && newy <= (theEagle[currentMap].listOfObstacles[i].y+obstacleWidth)){
			return 0;
		}
	}
	
	//if the move is legal and update value does not require adjustments, reset updatevalue to the original, in case it has been changed previously
	updateValue = originalUpdateValue;
	return 1;
}

